                <div class="buttonOne" type="button" onClick={clickStartButton}>GETTING STARTED</div>
                <div class="buttonTwo" type="button" onClick={clickInstructionsButton}>SHAPE</div>
                <div class="buttonTwo" type="button" onClick={clickInstructionsButton}>COLOR</div>
